import React from "react";
import "./Table.css";

const Table = () => {
    const sales = useSelector( (state)=> state.data.sales)
  return (
    <div className="table">
        <table>
            <thead>
                <tr>
                    <th> Week Ending</th>
                    <th> Retail Sales</th>
                    <th> Wholesale Sales</th>
                    <th> Units Sold</th>
                    <th> Retailer Margin</th>
                </tr>
            </thead>
        </table>
    </div>
  )
};
export default Table;
